import React from "react";

function PokeList({ pokemon, pokePic }) {
    return (
        <div className="container">
            {pokemon.map(p => (
                <div className="poke-div" key={p}>{p}</div>
            ))}

            {pokePic.map(pic => (
                <div className="poke-div"> <img src={pic} alt="picture"/></div>
            ))}

        </div>
    )
}

export default PokeList;
